import React from 'react';

import { Accordion } from './Accordion';

export default {
  title: '/Molecules/accordion',
  component: Button,
};

const Template = (args) => <Accordion {...args} />;

export const AccordionMolecules = Template.bind({});
AccordionMolecules.args = {
  label: '',
};
